import React from "react";

export const Cart = () => {
  return (
    <div>
      <div className="contenedor">
        <div className="cabecera"></div>

        <div className="menu"></div>

        <div className="contenido"></div>

        <div className="pie"></div>
      </div>
    </div>
  );
};
